script: |
  super -f text -I q11624.spq | sort > q11624.out

inputs:
  - name: q11624.spq
    data: |
      SELECT DISTINCT col0 - - 16 + - - col1 / - col1 * + + col0 AS col2 FROM tab2 (FORMAT parquet) cor0 WHERE + col0 NOT BETWEEN ( - col0 ) AND NULL;
  - name: tab2

outputs:
  - name: q11624.out
    data: |
